import { useState } from 'react';
import { useFinancialData } from './hooks/useFinancialData';
import { FiSearch, FiTrendingUp, FiDollarSign, FiBarChart2 } from 'react-icons/fi';
import StockChart from './components/StockChart';

function App() {
  const [symbol, setSymbol] = useState('IBM');
  const { data, loading, error } = useFinancialData(symbol);

  const handleSearch = (e) => {
    e.preventDefault();
    const newSymbol = e.target.elements.symbol.value.toUpperCase();
    setSymbol(newSymbol);
  };

  return (
    <div className="min-h-screen bg-gray-100 p-6">
      <header className="mb-8">
        <h1 className="text-3xl font-bold text-blue-600">💰 Financial Dashboard</h1>
        <p className="text-gray-600">Visualize stock market data in real-time</p>
      </header>

      <form onSubmit={handleSearch} className="flex w-full max-w-md gap-2 mb-8">
        <input
          type="text"
          name="symbol"
          placeholder="Search (e.g., AAPL, MSFT, BTC)"
          className="flex-1 p-3 border border-gray-300 rounded-lg focus:ring-2 focus:ring-blue-500"
          required
        />
        <button
          type="submit"
          className="bg-blue-600 hover:bg-blue-700 text-white px-4 py-2 rounded-lg flex items-center gap-2 transition-colors"
        >
          <FiSearch /> Search
        </button>
      </form>

      {data && (
        <div className="grid grid-cols-2 md:grid-cols-4 gap-4 mb-8">
          <div className="bg-white p-4 rounded-lg shadow-md hover:shadow-lg transition-shadow flex items-center gap-3">
            <FiTrendingUp className="text-green-500 text-2xl" />
            <div>
              <p className="text-gray-500">Current Price</p>
              <p className="text-xl font-bold">${data[0].close.toFixed(2)}</p>
            </div>
          </div>
          <div className="bg-white p-4 rounded-lg shadow-md hover:shadow-lg transition-shadow flex items-center gap-3">
            <FiBarChart2 className="text-blue-500 text-2xl" />
            <div>
              <p className="text-gray-500">Today's High</p>
              <p className="text-xl font-bold">${data[0].high.toFixed(2)}</p>
            </div>
          </div>
          <div className="bg-white p-4 rounded-lg shadow-md hover:shadow-lg transition-shadow flex items-center gap-3">
            <FiBarChart2 className="text-red-500 text-2xl" />
            <div>
              <p className="text-gray-500">Today's Low</p>
              <p className="text-xl font-bold">${data[0].low.toFixed(2)}</p>
            </div>
          </div>
          <div className="bg-white p-4 rounded-lg shadow-md hover:shadow-lg transition-shadow flex items-center gap-3">
            <FiDollarSign className="text-purple-500 text-2xl" />
            <div>
              <p className="text-gray-500">Volume</p>
              <p className="text-xl font-bold">{data[0].volume.toLocaleString()}</p>
            </div>
          </div>
        </div>
      )}

      {loading && (
        <div className="flex justify-center items-center h-64">
          <p className="text-gray-500">Loading data...</p>
        </div>
      )}
      {error && (
        <div className="bg-red-100 border border-red-400 text-red-700 px-4 py-3 rounded">
          Error: {error}
        </div>
      )}
      {data && (
        <div className="bg-white p-4 rounded-lg shadow-md">
          <StockChart data={data} symbol={symbol} />
        </div>
      )}
    </div>
  );
}

export default App;
